query FindTrendingStories($topicID: ID, $cursor: String, $cursorType: CursorType!, $size: Int!, $userAliasID: ID) {
  FindTrendingStories(topicID: $topicID, cursor: $cursor, cursorType: $cursorType, size: $size, userAliasID: $userAliasID) {
    edges {
      ...CompactStory
      __typename
    }
    cursorInfo {
      ...CursorInfo
      __typename
    }
    __typename
  }
}

fragment CompactStory on Story {
  __typename
  id
  title
  createdAt
  leadText
  publishedAt
  isAgeRestrictedContent
  slug
  isStickyStory
  isShowOnWeb
  isShowOnApp
  isDisableComment
  isDisableLike
  isDisableShare
  isSnackable
  metaDescription
  author {
    ...SimpleUser
    __typename
  }
  publisher {
    ...SimplePublisher
    __typename
  }
  leadMedia {
    ...Media
    __typename
  }
  headline {
    ...Headline
    __typename
  }
  statistic {
    ...StoryStatistic
    __typename
  }
}

fragment Headline on Headline {
  storyID
  desktopMedia {
    ...Media
    __typename
  }
  mobileMedia {
    ...Media
    __typename
  }
  startTime
  endTime
  __typename
}

fragment Media on Media {
  id
  title
  description
  publicID
  externalURL
  awsS3Key
  height
  width
  locationName
  locationLat
  locationLon
  mediaType
  mediaSourceID
  photographer
  eventDate
  __typename
}

fragment StoryStatistic on StoryStatistic {
  storyID
  commentCount
  likeCount
  __typename
}

fragment SimpleUser on User {
  __typename
  id
  name
  username
  aboutMe
  isVerified
  profilePictureMedia {
    ...Media
    __typename
  }
}

fragment SimplePublisher on Publisher {
  __typename
  id
  name
  slug
  description
  isVerified
  avatarMedia {
    ...Media
    __typename
  }
}

fragment CursorInfo on CursorInfo {
  size
  count
  countPage
  hasMore
  cursor
  cursorType
  nextCursor
  __typename
}

query FindAllActiveHeadlines($cursor: String!, $size: Int!, $channelSlug: String, $placement: Placement) {
  FindAllActiveHeadlines(cursor: $cursor, size: $size, cursorType: PAGE, channelSlug: $channelSlug, placement: $placement) {
    edges {
      coverMedia {
        ...Media
        __typename
      }
      story {
        ...CompactStory
        __typename
      }
      __typename
    }
    __typename
  }
}

